css:
atom-text-editor,
:host {
  background-color: #272b33;
  color: #abb2c0;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(153, 187, 255, 0.04);
}
atom-text-editor .invisible,
:host .invisible {
  color: #abb2c0;
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #528bff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #3d4350;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #528bff;
  box-sizing: border-box;
  background-color: #343944;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(171, 178, 192, 0.15);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(171, 178, 192, 0.15);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(171, 178, 192, 0.15);
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #636e84;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after,
:host .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(224, 82, 82, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #abb2c0;
  background-color: #2b3039;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: transparent;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #abb2c0;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #abb2c0;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #abb2c0;
}
.comment {
  color: #5b626f;
  font-style: italic;
}
.entity.name.type {
  color: #e5c17c;
}
.entity.other.inherited-class {
  color: #97c378;
}
.keyword {
  color: #c679dd;
}
.keyword.control {
  color: #c679dd;
}
.keyword.operator {
  color: #abb2c0;
}
.keyword.other.special-method {
  color: #61aeef;
}
.keyword.other.unit {
  color: #d29b67;
}
.storage {
  color: #c679dd;
}
.storage.type.annotation,
.storage.type.primitive {
  color: #c679dd;
}
.storage.modifier.package,
.storage.modifier.import {
  color: #abb2c0;
}
.constant {
  color: #d29b67;
}
.constant.variable {
  color: #d29b67;
}
.constant.character.escape {
  color: #57b6c2;
}
.constant.numeric {
  color: #d29b67;
}
.constant.other.color {
  color: #57b6c2;
}
.constant.other.symbol {
  color: #57b6c2;
}
.variable {
  color: #df6a73;
}
.variable.interpolation {
  color: #be4f44;
}
.variable.parameter {
  color: #abb2c0;
}
.invalid.illegal {
  background-color: #df6a73;
  color: #272b33;
}
.string {
  color: #97c378;
}
.string.regexp {
  color: #57b6c2;
}
.string.regexp .source.ruby.embedded {
  color: #ff8000;
}
.string.other.link {
  color: #df6a73;
}
.punctuation.definition.comment {
  color: #5b626f;
}
.punctuation.definition.method-parameters,
.punctuation.definition.function-parameters,
.punctuation.definition.parameters,
.punctuation.definition.separator,
.punctuation.definition.seperator,
.punctuation.definition.array {
  color: #abb2c0;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #61aeef;
}
.punctuation.definition.bold {
  color: #e5c17c;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #c679dd;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #be4f44;
}
.punctuation.section.method,
.punctuation.section.class,
.punctuation.section.inner-class {
  color: #abb2c0;
}
.support.class {
  color: #e5c17c;
}
.support.function {
  color: #57b6c2;
}
.support.function.any-method {
  color: #61aeef;
}
.entity.name.function {
  color: #61aeef;
}
.entity.name.class,
.entity.name.type.class {
  color: #e5c17c;
}
.entity.name.section {
  color: #61aeef;
}
.entity.name.tag {
  color: #df6a73;
}
.entity.other.attribute-name {
  color: #d29b67;
}
.entity.other.attribute-name.id {
  color: #61aeef;
}
.meta.class {
  color: #e5c17c;
}
.meta.class.body {
  color: #abb2c0;
}
.meta.method-call,
.meta.method {
  color: #abb2c0;
}
.meta.definition.variable {
  color: #df6a73;
}
.meta.link {
  color: #d29b67;
}
.meta.require {
  color: #61aeef;
}
.meta.selector {
  color: #c679dd;
}
.meta.separator {
  background-color: #373b41;
  color: #abb2c0;
}
.meta.tag {
  color: #abb2c0;
}
.none {
  color: #abb2c0;
}
.markup.bold {
  color: #d29b67;
  font-weight: bold;
}
.markup.changed {
  color: #c679dd;
}
.markup.deleted {
  color: #df6a73;
}
.markup.italic {
  color: #c679dd;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #61aeef;
}
.markup.inserted {
  color: #97c378;
}
.markup.list {
  color: #df6a73;
}
.markup.quote {
  color: #d29b67;
}
.markup.raw.inline {
  color: #97c378;
}
.source.cs .keyword.operator {
  color: #c679dd;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #df6a73;
}
.source.gfm .markup.link {
  color: #c679dd;
}
.source.gfm .link .entity {
  color: #61aeef;
}
.source.java .storage.modifier.import {
  color: #e5c17c;
}
.source.java .storage.type {
  color: #e5c17c;
}
.source.ruby .constant.other.symbol > .punctuation {
  color: inherit;
}
.source.python .keyword.operator.logical.python {
  color: #c679dd;
}
